import {TaskRow} from './TaskRow'

export const TaskTable = ({ tasks }) => {
  return (
    <table>
      <thead>
        <tr>Tasks</tr>
      </thead>
      <tbody>
        {tasks.map((task) => {
          return (
            <TaskRow/>
          );
        })}
      </tbody>
    </table>
  );
};
